on à base de poivron rouge 3,5% (poivrons mi-séchés 1 huile de colza, concentré de tomates, sel, jus de citron concentré, ail, sucre), fromage frais, beurre, tomates pelées concassées (tomates jus de tomate, acidifiant : acide citrique), amidon transformé de pomme de terre, huile de toumesol, épices et aromates 0,3% (poivron, poivre, coriandre, graines de moutarde, carvi, oignon, huile de colza), purée de tomate, protéines de laji, eau, sel. Gamiture à la viande d\'agneau traitée en salaison au curry sur pain de mie spécial à la farine complète de blé 18,3% : pain de mie spécial 6,8% [préparation à base de farine complète (farine complète de blé 2,3%, g!uien de blé, sel, agent de traitement de la farine : acide ascorbique), eau, farine de blé, améliorant de panification (farine de h.lé malté toasté, sucre caramélisé en poudre (sirop de glucose et sucre caramélisé), poudre de cacao dégraissé, farine de blé), beurre, levure de boulangerie, œuf entier en poudre, sel, gluten de blé], fromage frais, lait demi écrémé, viande d\'agneau cuite traitée en salaison 1,9% [épaule d\'agneau 1,7%, sel, fécule de pomme de terre, Lactose, acidifiant : citrate de sodium), préparation à base de tomates [tomates (tomates mi-séchées, concentré de tomates), huile de colza, sel, origan, sucre, ail], raisin sec (raisin, huile de coton non hydrogénée), marinade au curry 0,6% [huiles de colza-tournesol, épices et aromates (curcuma, coriandre, oignon, ail, cardamome, gingembre, cannelle), sel, arômes naturels, émulsifiant : mono et diglycérides d\'acides gras], persil, amidon transformé de pomme de terre, huile de tournesol, ail, cumin. Garniture aux rillettes de canard et zestes d\'orange sur pain de mie nature 17,2% : rillettes de canard 7,5% [viande de canard 3,3%, graisse de canard 2,2%, viande et gras de porc 1%, eau, sel, poivre], pain de mie nature 6,8% (farine de blé, eau, sirop de sucre inverti, he_uŒe, Q.euf entier en poudre, levure de boulangerie, écrémé en poudre, sel, sucre, fari