VALUES ('3560070707874', 'Plateau nem 3 saveurs', 'NEMS AU PORC (5x20g): Galette de riz 31% garnie d\'une farce au porc: Eau, poitrine de porc 12%, farine de riz 11%, oignon réhydraté, carotte, gras de porc 5%, vermicelle (amidon de haricot mungo, amidon de mais), huile de tournesol, farine de _blé_, protéines de _soja_, champignon noir, sel, sucre, huile de tournesol et/ou colza, épices (gingembre, cannelle, coriandre, piment, muscade, girofle, anis, poivre), sauce au _poisson_ (_poisson_, sel, eau), son de _blé_, levure, caramel aromatique (sucre, eau), vinaigre d\'alcool, _gluten_ de _blé_. Pourcentages exprimés sur le nem au porc. NEMS AU POULET ET AU CURRY (5x20g): Galette de riz 31% garnie d\'une farce au poulet et aux épices:: Viande de poulet 27%, eau, farine de riz 11%, oignon réhydraté, oignon frit (oignon, huile de tournesol), carotte, châtaine d\'eau, _lait_ demi-écrémé, huile de tournesol, lait de coco, peau de poulet 2.4%, farine de _blé_, ciboule, épices 1.1% (dont curry 0.1%), sel, ail, huile de tournesol et/ou colza, jus de citron, son de _blé_, arôme naturel, levure, caramel aromatique (sucre, eau), sucre, vinaigre d\'alcool, _gluten_ de _blé_. Pourcentages exprimés sur le nem au poulet et au curry. NEMS AUX LEGUMES (5x20g): Galette de riz 31% garnie d\'une farce aux légumes: Eau, farine de riz 11%, champignon noir 10%, oignon réhydraté 8.5%, carotte 8.5%, petit pois 6.5%, blanc d\'_œuf_, semoule de _blé_ dur, châtaigne d\'eau 5.2%, huile de tournesol, ciboule, huile de tournesol et/ou colza, sel, fécule de manioc, coriandre, piment, caramel aromatique (sucre, eau). Pourcentages exprimés sur le nem aux légumes. SAUCE NUOC MÂM (2x30g): eau, sucre, nuoc mâm 8% (_poisson_, sel, eau), vinaigre d\'alcool, sel. Pourcentage exprimés sur la sauce nuoc mâm.', 'https://static.openfoodfacts.org/images/products/356/007/070/7874/front_en.5.400.jpg', '7.9', '1.8', '22', '3.3', '2.4', '6.5', '2.1', '0.826771653543307', '', '0');

