amélisé), poudre de cacao dégraissé, farine de blé), beurre, levure de boulangerie, oeuf entier en poudre, sel, gluten de blé), lait demi-écrémé stérilisé, miel 2,3%, amande 1,9%, noisette 1,9%, pistache en poudre, 1,6%, amidon transformé de pomme de terre, huile de tournesol. ', 'https://static.openfoodfacts.org/images/products/356/007/075/7015/front.8.400.jpg', '14.4', '6.8', '21.8', '10.4', '3.1', '8.7', '1.016', '0.4', '', '0');

