roma natural de vainillal, azücar, grasas y aceite vegetales (palma, colza, coco, palmiste), chocolate blanco 5% [azücar, manteca de cacao, leche en polvo, emulgente: lecitinas (soja), aroma natural de vainilla], jarabe de azücar invertido, huevo, harina de soja, clara de huevo en polvo, coco deshidratado 0,3%, cacao magro en polvo, sal, leche en polvo, gasificantes: carbonatos de sodio - carbonatos de amonio - difosfatos, almidôn de trigo, aceite de cacahuete, harina de arroz, aromas, dextrosa, emulgente: lecitinas (soja). Puede contener trazas de frutos de câscara.', '', '28', '17', '62', '41', '2.5', '5.8', '0.3', '0.118110236220472', '', '0');

